import React from "react";
import Login from "./Project3/Login";
import Nav from "./Project3/Nav";
import Home from "./Project3/Home";
import Registration from "./Project3/Registrations";
import Admin from "./Project3/Admin";
function App() {
  return (
    <>
      <Login />
      <Nav />
      <Home />
      <Registration />
      <Admin />
    </>
  );
}
export default App;
